import Home from "~/components/pages/Home";
import Following from "~/components/pages/Following";

//Public Routes

const publicRoutes = [
  { path: "/", component: Home },
  { path: "/following", component: Following },
];

const privateRoutes = [];

export { publicRoutes, privateRoutes };
